import React from 'react';
import styled from 'styled-components';
import Navbar from '../components/Navbar';

const Home = () => {
  return (
    <>
      <Navbar />
      <HomeWrapper>Hello, world</HomeWrapper>
    </>
  );
};

const HomeWrapper = styled.div`
  color: black;
  font-size: 100px;
  width: 100%;
  height: 100vh;
`;

export default Home;
